// 使用されない関数（カバレッジテスト用）
function unusedFunction() {
  console.log('This function is never called');
}

// viewport幅に応じてコンテンツを調整
function adjustContent() {
  const width = window.innerWidth;
  if (width < 768) {
    document.body.classList.add('mobile');
  } else {
    document.body.classList.remove('mobile');
  }
}

window.addEventListener('resize', adjustContent);
adjustContent();

/* Base styles */
body {
  margin: 0;
  padding: 0;
  font-family: Arial, sans-serif;
  line-height: 1.6;
}

/* Header styles */
.header {
  background-color: #333;
  color: white;
  padding: 1rem;
}

.title {
  margin: 0;
  font-size: 2rem;
}

.nav {
  margin-top: 1rem;
}

.nav a {
  color: white;
  text-decoration: none;
  margin-right: 1rem;
}

.nav a:hover {
  text-decoration: underline;
}

/* Main content */
.main {
  padding: 2rem;
  min-height: 60vh;
}

.section {
  margin-bottom: 2rem;
  padding: 1rem;
  border: 1px solid #ddd;
  border-radius: 4px;
}

.hidden {
  display: none;
}

/* Responsive content */
.responsive-content {
  padding: 1rem;
  background-color: #f4f4f4;
}

.desktop-only {
  display: block;
}

.mobile-only {
  display: none;
}

/* Mobile styles */
@media (max-width: 768px) {
  .title {
    font-size: 1.5rem;
  }

  .main {
    padding: 1rem;
  }

  .desktop-only {
    display: none;
  }

  .mobile-only {
    display: block;
  }

  .nav a {
    display: block;
    margin-bottom: 0.5rem;
  }
}

/* Tablet styles */
@media (min-width: 769px) and (max-width: 1024px) {
  .section {
    padding: 1.5rem;
  }
}

/* Footer */
.footer {
  background-color: #333;
  color: white;
  padding: 1rem;
  text-align: center;
}

/* 使用されないスタイル（カバレッジテスト用） */
.unused-class {
  color: red;
  font-size: 3rem;
}

.another-unused {
  background-color: yellow;
  border: 5px solid green;
}

/* Button styles */
button {
  background-color: #007bff;
  color: white;
  border: none;
  padding: 0.5rem 1rem;
  border-radius: 4px;
  cursor: pointer;
}

button:hover {
  background-color: #0056b3;
}

/* Utility classes */
.text-center {
  text-align: center;
}

.mt-1 { margin-top: 0.5rem; }
.mt-2 { margin-top: 1rem; }
.mt-3 { margin-top: 1.5rem; }
.mt-4 { margin-top: 2rem; }
